import React from 'react';
import Title from '../Components/Title';
import ImageSection from '../Components/ImageSection';
import SkillsSection from '../Components/SkillsSection';

function AboutPage() {
    return (
        <div className="About">

            <Title title={'About Me'} span={'About Me'} />
            <ImageSection />
            <Title title={'My Skills'} span={'My Skills'} />
            <div className="skills-container">
                <SkillsSection skill={'HTML'} progress={'70%'} width={'70%'}/>
                <SkillsSection skill={'CSS/SCSS'} progress={'50%'} width={'50%'}/>
                <SkillsSection skill={'Javascript'} progress={'40%'} width={'40%'}/>
                <SkillsSection skill={'Express'} progress={'70%'} width={'70%'}/>
                <SkillsSection skill={'React'} progress={'70%'} width={'70%'}/>
                <SkillsSection skill={'Javascript'} progress={'70%'} width={'50%'}/>
            </div>
        </div>
    )
}

export default AboutPage
